import React from "react";
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함
import MainTab from "../../../common/MainTab";

function ArtView() {
    return (
        <div>
            {<MainTab history={this.props.history}/>}
            <div>
                <a>
                    art View
                </a>
            </div>
        </div>
    );
}

export default ArtView;
